import React, { ReactElement } from 'react';
import { RouteComponentProps } from '@reach/router';

import { Card, GridArea, Head } from '@/components/common';
import processes from '@/mock-files/processes.json';
import laptopImageSrc from '@/assets/images/laptop.png';
import './styles.scss';

function HomePage(props: RouteComponentProps): ReactElement {
  return (
    <>
      <Head
        title="Home Page"
        description="General content about the site"
      />
      <main>
        <section className="processes-page">
          <div className='processes-page_content-container'>
            <div className='processes-page_top'>
              <GridArea rows={processes.length / 3} columns={3}>
                {processes.map((item) => (
                  <Card title={item.title} text={item.text} />
                ))}
              </GridArea>
            </div>
          </div>
        </section>
      </main>
    </>
  );
}

export default HomePage;
